window.bookSummaryJSON = "<p><b>The residents of Riot House have graduated, but the events of the past year are far from forgotten.</b></p> <p>Life might be pulling the former students of Wolf Hall Academy in opposite directions, but no distance on Earth can sever the ties that bind them.</p> <p><b>Jacobi</b></p> <p>I wanted to break her...</p> <p>But she fixed me.</p> <p><b>Dash</b></p> <p>I lied to her...</p> <p>And she became my truth.</p> <p><b>Pax</b></p> <p>I gave her chaos...</p> <p>And she showed me peace.</p> <p><i>From </i>USA Today <i>bestselling author Callie Hart comes a brand new catch-up book in the Crooked Sinners series, featuring interwoven storylines told from multiple POVs. Intended for mature listeners.</i></p>"; 
